import React, { useEffect, useState } from "react";
import UnitDisplay from "../components/UnitDisplay";
import axios from "axios";
import api from "../highOrder/axios";

export default function Explore() {
  const [units, setUnits] = useState([]);

  useEffect(() => {
    const fetchAllUnits = async () => {
      try {
        const res = await api.get("unitlisting/");
        console.log(res.data.unitlisting);
        setUnits({ unit: res.data.unitlisting });
      } catch (err) {
        //Not in the 200 response range then
        if (err.response) {
          console.log(err.res.data.message);
          console.log(err.res.status);
          console.log(err.res.headers);
        } else {
          console.log(`Error: ${err.message}`);
        }
      }
    };
    fetchAllUnits();
  }, []);

  return (
    <>
      <h1>my Component has Mounted, Check the browser 'console' </h1>
      {units}
    </>
  );
}
